 ```l'été précédent, Folco avait entendu parler d'un trésor enfoui dans cette partie du lac. Il rêvait depuis longtemps d'y trouver de l'argent pour acheter des crayons colorés et d'autres jouets qu'il ne pouvait se permettre. Décidé à trouver le trésor, il amarra la barque à une rive, fit les derniers cent mètres à la nage et plongea dans l'eau chaude du lac.
Après quelques minutes d'exploration infructueuse, il remonta en soufflant et regarda autour de lui. La barque était coincée dans un marécage et les végétaux alentour semblaient plus épais qu'à l'accoutumée.
Alors que Folco s'apprêtait à rebrousser chemin, il aperçut quelque chose de bizarre sur le fond. C'était un objet métallique, un peu rouillé, mais visible. ``` The young boy, his heart racing with excitement, carefully pushed himself forward, his eyes fixed on the mysterious object. He reached out gingerly with one hand and touched the metal, feeling its cool surface beneath his fingers. As he got closer, he could make out the shape of a small chest, partially buried in the muddy bottom of the lake. Folco's breath caught in his throat;
